import React from 'react';
import '../../App.css';
import { Link } from 'react-router-dom';


function Registration() {

    return (
        <div className = "formulario">
            <br />
            <h2>Preencha os dados</h2>

                <Link to = "/version">
                   <button id = "buttonForm">
                       Continuar
                   </button>
                </Link>

        </div>
    );
}

export default Registration;
